import React from "react";
import "./Contact.css";
const Contact = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col-12">
          <h1 className="text-contact">Contact</h1>
        </div>
      </div>
    </div>
  );
};

export default Contact;
